  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:03.504064\",\n\t\"name\": \"air-issues-on-the-north-slope-of-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Energy resources development on the Central
  Alaskan arctic coastal zone has introduced large scale fuel burning equipment to
  the area, resulting in the emission of air pollutants. The extremes imposed by the
  harsh and isolated arctic environment have resulted in facility design and operations
  unique to oil and gas practices used elsewhere. This uniqueness in turn has raised
  questions ranging from the adequacy of current tools for evaluating ambient air
  impacts to applicability of certain mitigation measures for controlling air pollution.
  This paper will provide an overview of the activities of the oil industry on the
  Alaskan North Slope to determine the existing air quality, to predict the impact
  of their operations, to acquire reasonable permits for existing and future facilities
  and to provide adequate emission controls. Special problems and solutions will be
  discussed. Emerging concerns over arctic haze and black smoke will also be reviewed.\",\n\t\"license_title\":
